export default class CalcConstants {
  static VIEW_WIDTH = 200;
  static DEFAULT_VIEW_HEIGHT = 20;
  static DISPLAY_VIEW_HEIGHT = 28;

  static DEFAULT_FONT_SIZE = 13;
  static DEFAULT_FONT = CalcConstants.DEFAULT_FONT_SIZE + "px Arial";

  static DISPLAY_FONT_SIZE = 24;
  static DISPLAY_FONT = CalcConstants.DISPLAY_FONT_SIZE + "px Arial";

  static TEXT_BOTTOM_SPACING = 2;
}
